"  <div class=\"figure\" style=\"width: 562px\">",
"   <div class=\"ttl\">",
"    Dual resistance to adamantanes and oseltamivir among seasonal H1N1 influenza A viruses, 2008 to 2010",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 542px; height: 524px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Summary of genotypes of dual-resistant seasonal H1N1 influenza A viruses detected by full genome analysis, 2008-2010. Clade 2B genes are indicated by blue rectangles, and clade 2C genes are indicated by green rectangles. Oseltamivir resistance is indicated by a red solid outline. Adamantane resistance in the clade 2B M gene is indicated by a red dashed outline. Adamantane resistance in the clade 2C M gene is indicated by a red dotted outline. Reassortant genotypes are indicated by the bracket.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Sheu TG, Fry AM, Garten RJ, et al. Dual Resistance to Adamantanes and Oseltamivir Among Seasonal Influenza A(H1N1) Viruses: 2008-2010. J Infect Dis 2011; 203:13, by permission of Oxford University Press. Copyright &copy; 2011.",
