"   <div class=\"block pha drugH1Div\" id=\"F152436\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Competes with histamine for H",
"     <sub>",
"      1",
"     </sub>",
"     -receptor sites on effector cells in the gastrointestinal tract, blood vessels, and respiratory tract",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F152450\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Peak effect: Therapeutic: 5-7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 8-12 hours; may persist for 24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : ~800 L (range: 500-1000 L) (Sharma, 2003)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic; metabolized via unidentified enzymes by O-dealkylation followed by alcohol dehydration, aliphatic oxidation, aromatic oxidation, and direct oxidation; significant first-pass effect (Sharma,  2003)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: ~40% (Sharma, 2003)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: ~21 hours (range: 10-33 hours) (Sharma, 2003)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: 2-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~42% as metabolites) (Sharma, 2003)",
"    </p>",
"   </div>",
"  </div>",
