"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Excoriated papules with erosions and multiple hyperpigmented macules in a 25-year-old young woman who had developed acne papules a few years before. Chronic picking of papules resulted in erosions, scarring, and postinflammatory hyperpigmentation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
