var title_f6_62_7148="Surgical options for UC";
var content_f6_62_7148=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F56142&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F56142&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Choice of operation for ulcerative colitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Operation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Rectal mucosectomy with ileal pouch-anal canal anastomosis",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Complete excision of large intestinal disease",
"        <br/>",
"        Transanal defecation and fecal continence preserved",
"        <br/>",
"        No ileostomy",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Two operations required",
"        <br/>",
"        At risk for pouchitis",
"        <br/>",
"        Nocturnal fecal spotting present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Stapled, ileal pouch-distal rectal anastomosis",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Transanal defecation and fecal continence preserved",
"        <br/>",
"        No ileostomy",
"        <br/>",
"        Easier technically",
"       </td>",
"       <td>",
"        At risk for pouchitis and cancer from residual rectal mucosa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Continent ileostomy",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Complete excision of large intestinal disease",
"        <br/>",
"        Fecal continence preserved",
"        <br/>",
"        No external appliance",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Stoma present",
"        <br/>",
"        Intubation of pouch required",
"        <br/>",
"        At risk for pouchitis and need for valve revision",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Brooke ileostomy",
"       </td>",
"       <td>",
"        Complete excision of large intestinal disease",
"        <br/>",
"        One operation",
"       </td>",
"       <td>",
"        Stoma present, risk of parastomal hernia",
"        <br/>",
"        Incontinent for feces",
"        <br/>",
"        Need of external appliance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        Ileorectal anastomosis",
"       </td>",
"       <td>",
"        Transanal defecation and fecal continence preserved",
"        <br/>",
"        No ileostomy",
"       </td>",
"       <td>",
"        Diseased rectum remains to produce symptoms, require treatment and predispose to cancer",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
