"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    List of new platelet function tests",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Platelet function test",
"      </td>",
"      <td class=\"subtitle1\">",
"       Aspects of platelet function measured",
"      </td>",
"      <td class=\"subtitle1\">",
"       Advantages",
"      </td>",
"      <td class=\"subtitle1\">",
"       Disadvantages",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Clot Signature Analyser (CSA)",
"      </td>",
"      <td>",
"       Global Haemostasis High Shear platelet function",
"      </td>",
"      <td>",
"       Measures Global Hemostatic Function",
"      </td>",
"      <td>",
"       Cost of cartridges",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cone &amp; Plate Analyser (CPA)",
"      </td>",
"      <td>",
"       High shear platelet adhesion/aggregation",
"      </td>",
"      <td>",
"       Small volume of blood, physiological",
"      </td>",
"      <td>",
"       Requires image analysis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Flow Cytometry",
"      </td>",
"      <td>",
"       Platelet glycoproteins, activation markers, platelet function",
"      </td>",
"      <td>",
"       Whole blood test, flexible, wide variety of tests, powerful",
"      </td>",
"      <td>",
"       Specialized operator, expensive equipment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       ICHOR (Plateletworks)",
"      </td>",
"      <td>",
"       Platelet counting pre- and post platelet activation",
"      </td>",
"      <td>",
"       Simple point of care",
"      </td>",
"      <td>",
"       Preparation of Reagents",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Haemodyne",
"      </td>",
"      <td>",
"       Platelet Contractile force",
"      </td>",
"      <td>",
"       Rapid and Simple",
"      </td>",
"      <td>",
"       Measures clot properties only",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hemostasus Device activity",
"      </td>",
"      <td>",
"       Platelet procoagulant function",
"      </td>",
"      <td>",
"       Simple",
"      </td>",
"      <td>",
"       Insensitive to aspirin and GpIb",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Laser Platelet Aggregometer (PA-200)",
"      </td>",
"      <td>",
"       Platelet micro-aggregates",
"      </td>",
"      <td>",
"       Sensitive, study hyperfunction",
"      </td>",
"      <td>",
"       Little widespread experience",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Platelet Function Analyser (PFA-100)",
"      </td>",
"      <td>",
"       High Shear adhesion/aggregation",
"      </td>",
"      <td>",
"       Rapid and simple screening, In vitro bleeding time, Potential point of care instrument",
"      </td>",
"      <td>",
"       Inflexible",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Thrombotic Status Analyser (TSA)",
"      </td>",
"      <td>",
"       High shear platelet function",
"      </td>",
"      <td>",
"       Simple",
"      </td>",
"      <td>",
"       Little widespread experience",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Thromboelastometry (ROTEM)",
"      </td>",
"      <td>",
"       Measures global hemostasis",
"      </td>",
"      <td>",
"       Can predict bleeding",
"      </td>",
"      <td>",
"       Insensitive to aspirin",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"3\">",
"       Verify Now Test (rapid platelet function analyzer)",
"      </td>",
"      <td>",
"       GP IIb/IIIa dependent aggregation",
"      </td>",
"      <td rowspan=\"3\">",
"       Simple test for monitoring drug effect using three different cartridges",
"      </td>",
"      <td rowspan=\"3\">",
"       Inflexible",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Aspirin effect",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       P2Y12 blockade",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Placor PRT",
"      </td>",
"      <td rowspan=\"2\">",
"       Platelet hyperfunction",
"      </td>",
"      <td rowspan=\"2\">",
"       Rapid point of care test using fingerprick blood",
"      </td>",
"      <td>",
"       Little widespread experience",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Platelets will be activated by finger wound",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Thrombovision T guide",
"      </td>",
"      <td>",
"       Platelet aggregation in response to agonists by light scatter",
"      </td>",
"      <td>",
"       Automated point of care test",
"      </td>",
"      <td>",
"       Little widespread experience",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
