" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Size and charge determinants of glomerular permeability",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 269px; height: 198px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Fractional clearances (the ratio of the filtration of a substance to that of inulin, which is freely filtered) of anionic, neutral (middle curve), and cationic dextrans as a function of effective molecular radius. Both molecular size and charge are important determinants of filtration, as smaller or cationic dextrans are more easily filtered. As a reference, the effective molecular radius of albumin (which is anionic in the physiologic pH range) is 36 &Aring;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from the American Society for Clinical Investigation Bohrer MP, et al, J Clin Invest 1978; 61:72.",
"    </div>",
